import DefaultLayout from '../components/layouts/DefaultLayout';
import HeadlineModule from '../components/modules/HeadlineModule/index';
import fetch from 'isomorphic-unfetch';

/* This route gets hit by default, e.g. your-site.com */
const DefaultPage = ({data}) => {
  const {content} = data;
  const headlineModuleData = content.body.find(
    item => item.component === 'Headline'
  );
  return (
    <DefaultLayout>
      <h1>Default Page</h1>
      <a href="/welcome">->Visit a Slug Page</a>
      {headlineModuleData ? (
        <HeadlineModule
          title={headlineModuleData.title}
          subtitle={headlineModuleData.subtitle}
          button={headlineModuleData.button}
        />
      ) : null}
    </DefaultLayout>
  );
};

export default DefaultPage;
